"""Git stash."""

# ## Questions
#
# 1. Что делает команда `git stash`?
# 2. Как просмотреть список всех сохранённых изменений (стэшей)?
# 3. Какая команда применяется для использования верхнего стэша?
# 4. Как применить конкретный стэш по его номеру?
# 5. Чем отличается команда `git stash apply` от `git stash pop`?
# 6. Что делает команда `git stash drop`?
# 7. Как полностью очистить все сохранённые стэши?
# 8. В каких случаях удобно использовать `git stash`?
# 9. Что произойдёт, если выполнить `git stash pop`, но в проекте есть конфликтующие изменения?
# 10. Можно ли восстановить удалённый стэш после выполнения `git stash drop`?
# 11. Что делает команда `git stash save "NAME_STASH"`?
# 12. Что делает команда `git stash apply "NUMBER_STASH"`?
# 13. Что делает команда `git stash pop "NUMBER_STASH"`?
# 14. Сохраните текущие изменения в стэш под названием `"SENATOROV ver1"`, вставьте скриншот из терминала.
# 15. Внесите любые изменения в ваш репозиторий и сохраните второй стэш под именем `"SENATOROV ver2"`.
# 16. Восстановите ваш стэш `"SENATOROV ver1"`, вставьте скриншот из терминала.
# 17. Удалите все стэши из истории, вставьте скриншот из терминала.

# ## Answers
#
# 1. It temporarily saves uncommitted changes in a stack, allowing you to work on a clean repository without losing your work.
# 2. Use `git stash list` to see all saved stashes.
# 3. Use `git stash pop` to apply the latest (top) stash.
# 4. Use `git stash apply stash@{N}`, where `N` is the stash index number.
# 5. `git stash apply` applies the stash but keeps it in the stash list, while `git stash pop` applies the stash and removes it from the list.
# 6. It deletes a specific stash from the stash list.
# 7. Use `git stash clear` to remove all stashes.
# 8. When you need to switch branches without committing unfinished work or temporarily save changes for later.
# 9. Git will attempt to apply the changes, but conflicts will occur. You'll need to resolve them manually.
# 10. It’s difficult, but sometimes possible by finding the stash’s reference in the reflog before it’s garbage collected.
# 11. It saves your current changes in a stash with the given name `"NAME_STASH"`.
# 12. It applies the stash specified by its number, e.g., `git stash apply stash@{1}`.
# 13. It applies and removes the specific stash from the list, e.g., `git stash pop stash@{1}`.
